        userImage: 'https://cdn.vox-cdn.com/thumbor/s6cI4NEU9hgaUFjXfyVPMmMc044=/cdn.vox-cdn.com/uploads/chorus_asset/file/3847870/11376655_479893395513491_201556343_n.0.jpg',
        tempo: 'ontem'
    }

    return (
        <div className={styles.container}>
            <PostImage />
            <InteractionScreen />
        </div>
    )
}
